import { Component, OnInit } from '@angular/core';
import { StudentService } from '../../../services/student/student.service';
import { Student } from '../../../models/student';

@Component({
  selector: 'app-user-list',
  templateUrl: './user-list.component.html',
  styleUrls: ['./user-list.component.css']
})
export class UserListComponent {
  public studentList: Student[] = [];
  public displayStudentArchived: boolean = false;

  constructor(public StudentService: StudentService) {
    this.StudentService.Students$.subscribe((Students) => this.studentList = Students);
  }

  ngOnInit() {
  }

  StudentHasBeenSelected(hasBeenSelected: boolean) {
    console.log('event received from child:', hasBeenSelected);
  }

  archivedStudent(Student: Student) {
    // console.log(Student);
    this.StudentService.archivedStudent(Student);
  }

}
